/*FlipClockInit.js*/
var $eventsContainer = $('.event-container');
var eventDates = [];
var eventClicked = 2;
var url = 'https://query.yahooapis.com/v1/public/yql';
var fromWebsite = "https://www.octafx.co.uk";
$.getJSON(url, "q=select%20*%20from%20html%20where%20url%3D%22https%3A%2F%2Fwww.octafx.co.uk%2F%22&format=json&diagnostics=true&env=store%3A%2F%2Fdatatables.org%2Falltableswithkeys").done(function (data) {
    //console.log(data);
    var body = data.query.results.body.div[2];
    var oEvents = (body.div[1].div[3].div[0].div.div.div[2].div[1].div[2].div);

    //console.log(oEvents);
    for(var i = 2; i < oEvents.length - 1; i++){
        var temp;

        temp = {
            "id": i,
            "flag": fromWebsite + oEvents[i].span.img.src,
            "alt": oEvents[i].span.img.alt,
            "time": oEvents[i][ 'data-time' ],
            "title": oEvents[i].a.content,
            "forex": oEvents[i].span.em
        };
        eventDates[i] = temp;
    }

    var clock = $('.countdown-timer').FlipClock({
        clockFace: 'HourlyCounter',
        countdown: true
    });


    clock.setTime(eventDates[eventClicked].time);

    $eventsContainer.find('img').attr('src', eventDates[eventClicked].flag);
    $eventsContainer.find('a').text(eventDates[eventClicked].title);
    $eventsContainer.find('p').text(eventDates[eventClicked].forex);

    clock.start();

    $('.countdown-timer').find('.flip-clock-label').hide();


    $('.arrow-left').on('click', function(){
        if(eventClicked == 0 || eventClicked < 0){
            $(this).addClass('disabled');
        }
        else{
            if(eventClicked < 2){
                eventClicked = 2
            }
            else{
                eventClicked--;
            }
            $eventsContainer.find('img').attr('src', eventDates[eventClicked].flag);
            $eventsContainer.find('a').text(eventDates[eventClicked].title);
            $eventsContainer.find('p').text(eventDates[eventClicked].forex);
            clock.setTime(eventDates[eventClicked].time);
        }
    });

    $('.arrow-right').on('click', function(){
        if(eventClicked == eventDates.length){
            $(this).addClass('disabled');
        }
        else{
            if(eventClicked > oEvents.length - 1){
                eventClicked = oEvents.length - 1
            }
            else{
                eventClicked++;
            }
            $eventsContainer.find('img').attr('src', eventDates[eventClicked].flag);
            $eventsContainer.find('a').text(eventDates[eventClicked].title);
            $eventsContainer.find('p').text(eventDates[eventClicked].forex);
            clock.setTime(eventDates[eventClicked].time);
            //clock.start();
        }

    });

});




